	  Dmat(i, j) = 0._dp
	 else
      Dmat(i, j) = (stress(i) + sigma_NN_i1(i,1)*50.) / (stran(j)+DSTRAN(j))
	 end if
    end do
  end do

  ! print*,sigma_NN_i1(:,1)*50.
