   DDSDDE   = Dmat
   STRESS(:)   = STRESS(:) + sigma_NN_i1(:,1)*50.

   print*,Dmat(1,:)
   print*,Dmat(2,:)
   print*,Dmat(3,:)
   print*,'empty line'
   
end subroutine umat